import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class AddOnCart extends Component {
  render() {
    const { produto } = this.props;
    return (
      <div>
        <h1>{produto.item}</h1>
      </div>
    );
  }
}

AddOnCart.propTypes = {
  produto: PropTypes.func.isRequired,
};
